    methods: {
        changeMouth(opt, index) {

            // document.getElementById("mouth").innerHTML = this.mouths.a
            setTimeout(() => {
                // console.log(opt, index);
                switch (opt) {
                    case 'a':
                        document.getElementById("mouth").innerHTML = this.mouths.a
                        break;
                    case 'e':
                        document.getElementById("mouth").innerHTML = this.mouths.e
                        break;
                    case 'i':
                        document.getElementById("mouth").innerHTML = this.mouths.i
                        break;
                    case 'u':
                        document.getElementById("mouth").innerHTML = this.mouths.u
                        break;
                    case 'o':
                        document.getElementById("mouth").innerHTML = this.mouths.o
                        break;
                    case 'a':
                        document.getElementById("mouth").innerHTML = this.mouths.a
                        break;
                    default:
                        // document.getElementById("mouth").innerHTML = this.mouths.default
                        break;
                }
            }, 60 * index);

            document.getElementById("mouth").innerHTML = this.mouths.default
        }
    },
}
